import React, { Component } from 'react';
// import '../css/Web.css';

import WebProject from '../presentational/WebProject';

class Web extends Component {
  render() {
    return (
      <div className="Web">
        <h1>Web</h1>

        this.renderWebProjects();

      </div>
    );
  }

  ///////////////////

  renderWebProjects = () => {
    const projects = [
      'djin',
      'shrinelords',
      'forevernote',
    ]

    return (
      projects.map(p => {
        return <WebProject project={p} />
      })
    )
  }
}

export default Web;
